def print_hello(n):
    """
    Print Hello World.
    
    Args:
        n (int): number of iterations.
        
    Returns:
        None
    
    Examples:
        >>> kkpy.print_hello(2)
        'Hello World!'
        'Hello World!'
    """
    
    for _ in range(n):
        print('Hello World!')
    
    return None

